import React from 'react'

import { HeaderMainLeftNav } from './HeaderMainLeftNav/HeaderMainLeftNav'
import { HeaderMainRightNav } from './HeaderMainRightNav/HeaderMainRightNav'


export const HeaderMainNav = () => {
  return (
    <div className="container-fluid">
      <div className="row">
        <HeaderMainLeftNav />
        <HeaderMainRightNav />
      </div>
    </div>
  )
}
